import { Button, Container } from "react-bootstrap";
import React, { useState, useEffect } from "react";

export default function GetTrash() {
  const [trash, setTrash] = useState([]);

  const query = new URLSearchParams({
    name: "",
    start_date_deleted: "1682005643110", //6 days starting frmo this date back
    "type[]": [
      "task",
      "subtask",
      "subcategory",
      "category",
      "project",
      "doc",
      "conversation",
      "page",
      "field",
      "dashboard",
      "projectTag",
      "form",
      "reminder",
      "timeEntry",
    ],
  }).toString();

  fetch(`https://app.clickup.com/trash/v1/team/36226095/trash?${query}`, {
    method: "GET",
    headers: {
      Authentication:
        "Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyIjo1NDA5ODc0MCwidmFsaWRhdGVkIjp0cnVlLCJzZXNzaW9uX3Rva2VuIjp0cnVlLCJ3c19rZXkiOjEzMDc4Mzc2NzMsImlhdCI6MTY4MjQ4Mjg3NSwiZXhwIjoxNjgyNjU1Njc1fQ.NsdHLKrz6xU_MAq0sJFPsMyGT0CmsNdYQ9Oeq8fB62w",
    },
  })
    .then((response) => response.json())
    .then((json) => setTrash(json))
    .catch((error) => console.error(error));

  return (
    <Container>
      <Button onClick={setTrash([])}>GET</Button>
      {trash ? <pre>{JSON.stringify(trash, null, 2)}</pre> : "Loading..."}
    </Container>
  );
}
